import React from "react";

interface EventMarkerProps {
  active: boolean;
  onClick: () => void;
  label: string;
}

const EventMarker: React.FC<EventMarkerProps> = ({ active, onClick, label }) => {
  return (
    <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
      <span style={{ marginBottom: "5px", color: active ? "blue" : "black" }}>{label}</span>
      <div
        className={`dots ${active ? "active" : ""}`}
        onClick={onClick}
      />
    </div>
  );
};

export default EventMarker;
